import React, { useState, useRef } from "react";

const SuggestionForm = ({ isOpen, onClose, darkMode }) => {
  const [formData, setFormData] = useState({
    siteName: "",
    siteUrl: "",
    description: "",
    type: "Film",
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitStatus, setSubmitStatus] = useState(null);
  const modalRef = useRef(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    // Remplacez VOTRE_URL_WEBHOOK par votre véritable URL webhook Discord
    const webhookUrl = "VOTRE_URL_WEBHOOK";

    const message = {
      embeds: [
        {
          title: "Nouvelle suggestion de site",
          color: 3447003,
          fields: [
            {
              name: "Nom du site",
              value: formData.siteName,
            },
            {
              name: "URL",
              value: formData.siteUrl,
            },
            {
              name: "Description",
              value: formData.description,
            },
            {
              name: "Type",
              value: formData.type,
            },
          ],
        },
      ],
    };

    try {
      const response = await fetch(webhookUrl, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(message),
      });

      if (response.ok) {
        setSubmitStatus("success");
        setTimeout(() => {
          onClose();
          setSubmitStatus(null);
          setFormData({
            siteName: "",
            siteUrl: "",
            description: "",
            type: "Film",
          });
        }, 2000);
      } else {
        setSubmitStatus("error");
      }
    } catch (error) {
      setSubmitStatus("error");
    } finally {
      setIsSubmitting(false);
    }
  };

  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
      <div
        ref={modalRef}
        className={`p-6 rounded-lg shadow-xl w-96 ${
          darkMode ? "bg-gray-800 text-white" : "bg-white text-black"
        }`}
      >
        <h2 className="text-2xl font-bold mb-4">Suggérer un site</h2>

        <form onSubmit={handleSubmit}>
          <div className="space-y-4">
            <div>
              <label className="block mb-1">Nom du site</label>
              <input
                type="text"
                value={formData.siteName}
                onChange={(e) =>
                  setFormData({ ...formData, siteName: e.target.value })
                }
                className={`w-full p-2 rounded border ${
                  darkMode
                    ? "bg-gray-700 border-gray-600"
                    : "bg-white border-gray-300"
                }`}
                required
              />
            </div>

            <div>
              <label className="block mb-1">URL du site</label>
              <input
                type="url"
                value={formData.siteUrl}
                onChange={(e) =>
                  setFormData({ ...formData, siteUrl: e.target.value })
                }
                className={`w-full p-2 rounded border ${
                  darkMode
                    ? "bg-gray-700 border-gray-600"
                    : "bg-white border-gray-300"
                }`}
                required
              />
            </div>

            <div>
              <label className="block mb-1">Description</label>
              <textarea
                value={formData.description}
                onChange={(e) =>
                  setFormData({ ...formData, description: e.target.value })
                }
                className={`w-full p-2 rounded border ${
                  darkMode
                    ? "bg-gray-700 border-gray-600"
                    : "bg-white border-gray-300"
                }`}
                rows="3"
                required
              />
            </div>

            <div>
              <label className="block mb-1">Type</label>
              <select
                value={formData.type}
                onChange={(e) =>
                  setFormData({ ...formData, type: e.target.value })
                }
                className={`w-full p-2 rounded border ${
                  darkMode
                    ? "bg-gray-700 border-gray-600"
                    : "bg-white border-gray-300"
                }`}
                required
              >
                <option value="Film">Film</option>
                <option value="Série">Série</option>
                <option value="Anime">Anime</option>
              </select>
            </div>
          </div>

          <div className="mt-6 flex justify-end space-x-4">
            <button
              type="button"
              onClick={onClose}
              className="px-4 py-2 rounded bg-red-500 text-white hover:bg-red-600"
            >
              Annuler
            </button>
            <button
              type="submit"
              disabled={isSubmitting}
              className={`px-4 py-2 rounded text-white ${
                isSubmitting ? "bg-gray-400" : "bg-blue-500 hover:bg-blue-600"
              }`}
            >
              {isSubmitting ? "Envoi..." : "Envoyer"}
            </button>
          </div>

          {submitStatus && (
            <div
              className={`mt-4 p-2 rounded text-center ${
                submitStatus === "success"
                  ? "bg-green-100 text-green-700"
                  : "bg-red-100 text-red-700"
              }`}
            >
              {submitStatus === "success"
                ? "Suggestion envoyée avec succès !"
                : "Erreur lors de l'envoi. Veuillez réessayer."}
            </div>
          )}
        </form>
      </div>
    </div>
  );
};

export default SuggestionForm;
